import React, { Component } from "react";

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count1: 0,
      count2: 0,
    };
  }

  handleButton = () => {
    this.setState({ count1: this.state.count1 + 1 });
  };

  handleButton1 = () => {
    this.setState({ count2: this.state.count2 + 1 });
  };

  render() {
    const { count1, count2 } = this.state;
    return (
      <div>
        <button onClick={this.handleButton}>hello {count1}</button>
        <button onClick={this.handleButton1}>world {count2}</button>
      </div>
    );
  }
}

export default Home;
